  true,\n\t\"url\": null,\n\t\"notes\": \"The Nitrogen Fertilizer Application dataset
  of the Global Fertilizer and Manure, Version 1 Data Collection represents the amount
  of nitrogen fertilizer nutrients applied to nncroplands. The national-level nitrogen
  fertilizer application rates for crops are from the International Fertilizer Industry
  Association (IFA) \"Fertilizer Use by Crop 2002\" statistics nndatabase that is
  available by request from the Food and Agriculture Organization (FAO). The number
  of crop-specific fertilizer application rates reported for each country ranged from
  2 nncrops (Guinea) to over 50 crops (United States), and the years for which the
  data are reported range from 1994 to 2001. Spatially explicit fertilizer inputs
  of Nitrogen (N) were computed nnby fusing national-level statistics on fertilizer
  use with global maps of harvested area for 175 crops. The data were compiled by
  Potter et al. (2010) and are distributed by the Columbia nnUniversity Center for
  International Earth Science Information Network (CIESIN).\",\n\t\"license_title\":
